import * as React from "react";
import { Routes, Route, Link } from "react-router-dom";
import stylesheet from './styles.js'
import Button from './Button';

function Interest() {


		return (
			<div style={stylesheet.body}>
				<h1>Choose your Universe</h1>
				<Button title="Social Good Universe" />
				<Button path="/interest" text="Gaming Universe" />
				<Button path="/interest" text="NFT Universe" />
				<Button path="/interest" text="Music Universe" />
			</div>
		);


}

export default Interest;
